#include <stdio.h>
#include <math.h>
#include <stdlib.h>
#include "lenet_weights.h"

/* ******************** resize constants ******************** */
#define WIDTH  320 
#define HEIGHT 240
/* ******************** resize constants ******************** */


/* ******************** lenet model constants ******************** */
#define INPUT_SIZE 28
// conv1
#define CONV1_FILTERS 6
#define CONV1_KERNEL_SIZE 5
#define CONV1_OUTPUT_SIZE 24 // 28 - 5 + 1
// pool1
#define POOL1_OUTPUT_SIZE 12 // 24 / 2
// conv2
#define CONV2_FILTERS 16
#define CONV2_KERNEL_SIZE 5
#define CONV2_OUTPUT_SIZE 8  // 12 - 5 + 1 after pooling
// pool2
#define POOL2_OUTPUT_SIZE 4 // 8 / 2
// fully connected
#define FC1_SIZE 120
#define FC2_SIZE 84
#define OUTPUT_CLASSES 10
/* ******************** lenet model constants ******************** */


/* ******************** lenet model weights ******************** */
float conv1_weights[CONV1_FILTERS][1][CONV1_KERNEL_SIZE][CONV1_KERNEL_SIZE];  // Conv1 weights (6 filters, 1 input channel, 5x5 kernels)
float conv1_biases[CONV1_FILTERS]; // Conv1 biases (6 filters)

float conv2_weights[CONV2_FILTERS][CONV1_FILTERS][CONV2_KERNEL_SIZE][CONV2_KERNEL_SIZE];  // Conv2 weights (16 filters, 6 input channels, 5x5 kernels)
float conv2_biases[CONV2_FILTERS]; // Conv2 biases (16 filters)

float fc1_weights[FC1_SIZE][CONV2_FILTERS * POOL2_OUTPUT_SIZE * POOL2_OUTPUT_SIZE];  // FC1 weights (120 neurons, flattened 16*8*8)
float fc1_biases[FC1_SIZE]; // FC1 biases (120 neurons)

float fc2_weights[FC2_SIZE][FC1_SIZE];  // FC2 weights (84 neurons, 120 neurons from FC1)
float fc2_biases[FC2_SIZE]; // FC2 biases (84 neurons)

float fc3_weights[OUTPUT_CLASSES][FC2_SIZE];  // FC3 weights (10 output classes, 84 neurons from FC2)
float fc3_biases[OUTPUT_CLASSES]; // FC3 biases (10 output classes)
/* ******************** lenet model weights ******************** */


/* ******************** lenet model layers ******************** */
// ReLU activation function
float relu(float x) {
    return (x > 0) ? x : 0;
}

// Convolution layer 1
void conv2d_layer1(float input[INPUT_SIZE][INPUT_SIZE], 
                   float output[CONV1_FILTERS][CONV1_OUTPUT_SIZE][CONV1_OUTPUT_SIZE]) {
    for (int f = 0; f < CONV1_FILTERS; f++) {
        for (int i = 0; i < CONV1_OUTPUT_SIZE; i++) {
            for (int j = 0; j < CONV1_OUTPUT_SIZE; j++) {
                output[f][i][j] = 0;
                for (int m = 0; m < CONV1_KERNEL_SIZE; m++) {
                    for (int n = 0; n < CONV1_KERNEL_SIZE; n++) {
                        output[f][i][j] += input[i+m][j+n] * conv1_weights[f][0][m][n];
                    }
                }
                output[f][i][j] += conv1_biases[f]; // Add bias
                output[f][i][j] = relu(output[f][i][j]); // Apply ReLU
            }
        }
    }
}

// Convolution layer 2
void conv2d_layer2(float input[CONV1_FILTERS][POOL1_OUTPUT_SIZE][POOL1_OUTPUT_SIZE], 
                   float output[CONV2_FILTERS][CONV2_OUTPUT_SIZE][CONV2_OUTPUT_SIZE]) {
    for (int f = 0; f < CONV2_FILTERS; f++) {
        for (int i = 0; i < CONV2_OUTPUT_SIZE; i++) {
            for (int j = 0; j < CONV2_OUTPUT_SIZE; j++) {
                output[f][i][j] = 0;
                for (int m = 0; m < CONV2_KERNEL_SIZE; m++) {
                    for (int n = 0; n < CONV2_KERNEL_SIZE; n++) {
                        for (int c = 0; c < CONV1_FILTERS; c++) {  // We now have 6 channels from Conv1 layer
                            output[f][i][j] += input[c][i+m][j+n] * conv2_weights[f][c][m][n];
                        }
                    }
                }
                output[f][i][j] += conv2_biases[f]; // Add bias
                output[f][i][j] = relu(output[f][i][j]); // Apply ReLU
            }
        }
    }
}

// Max Pooling layer 1
void max_pool1(float input[CONV1_FILTERS][CONV1_OUTPUT_SIZE][CONV1_OUTPUT_SIZE], 
               float output[CONV1_FILTERS][POOL1_OUTPUT_SIZE][POOL1_OUTPUT_SIZE]) {
    for (int f = 0; f < CONV1_FILTERS; f++) {
        for (int i = 0; i < POOL1_OUTPUT_SIZE; i++) {
            for (int j = 0; j < POOL1_OUTPUT_SIZE; j++) {
                float max_val = input[f][i*2][j*2];
                for (int m = 0; m < 2; m++) {
                    for (int n = 0; n < 2; n++) {
                        max_val = fmaxf(max_val, input[f][i*2+m][j*2+n]);
                    }
                }
                output[f][i][j] = max_val;
            }
        }
    }
}

// Max Pooling layer 2
void max_pool2(float input[CONV2_FILTERS][CONV2_OUTPUT_SIZE][CONV2_OUTPUT_SIZE], 
               float output[CONV2_FILTERS][POOL2_OUTPUT_SIZE][POOL2_OUTPUT_SIZE]) {
    for (int f = 0; f < CONV2_FILTERS; f++) {
        for (int i = 0; i < POOL2_OUTPUT_SIZE; i++) {
            for (int j = 0; j < POOL2_OUTPUT_SIZE; j++) {
                float max_val = input[f][i * 2][j * 2];
                for (int m = 0; m < 2; m++) {
                    for (int n = 0; n < 2; n++) {
                        max_val = fmaxf(max_val, input[f][i * 2 + m][j * 2 + n]);
                    }
                }
                output[f][i][j] = max_val;
            }
        }
    }
}

// Flatten layer
void flatten(float input[CONV2_FILTERS][POOL2_OUTPUT_SIZE][POOL2_OUTPUT_SIZE],
             float output[CONV2_FILTERS * POOL2_OUTPUT_SIZE * POOL2_OUTPUT_SIZE]) {
    int idx = 0;
    for (int f = 0; f < CONV2_FILTERS; f++) {
        for (int i = 0; i < POOL2_OUTPUT_SIZE; i++) {
            for (int j = 0; j < POOL2_OUTPUT_SIZE; j++) {
                output[idx++] = input[f][i][j];
            }
        }
    }
}

// Fully Connected layer 1
void fully_connected_fc1(float input[], 
						 float output[], 
						 float weights[FC1_SIZE][CONV2_FILTERS * POOL2_OUTPUT_SIZE * POOL2_OUTPUT_SIZE], 
						 float biases[], 
						 int input_size, 
						 int output_size) {
	for (int i = 0; i < output_size; i++) {
		output[i] = 0;
		for (int j = 0; j < input_size; j++) {
			output[i] += input[j] * weights[i][j];
		}
		output[i] += biases[i]; // Add bias term
	}
}

// Fully Connected layer 2
void fully_connected_fc2(float input[], 
						 float output[], 
						 float weights[FC2_SIZE][FC1_SIZE], 
						 float biases[], 
						 int input_size, 
						 int output_size) {
	for (int i = 0; i < output_size; i++) {
		output[i] = 0;
		for (int j = 0; j < input_size; j++) {
			output[i] += input[j] * weights[i][j];
		}
		output[i] += biases[i]; // Add bias term
	}
}

// Fully Connected layer 3
void fully_connected_fc3(float input[], 
						 float output[], 
						 float weights[OUTPUT_CLASSES][FC2_SIZE], 
						 float biases[], 
						 int input_size, 
						 int output_size) {
	for (int i = 0; i < output_size; i++) {
		output[i] = 0;
		for (int j = 0; j < input_size; j++) {
			output[i] += input[j] * weights[i][j];
		}
		output[i] += biases[i]; // Add bias term
	}
}

// Final Prediction
void predict(float output[OUTPUT_CLASSES],
             int *predict_class) {
    // Output the classification result
    *predict_class = 0;
    float max_value = output[0];
    // printf("Output of class 0: %f\n", output[0]);
    for (int i = 1; i < OUTPUT_CLASSES; i++) {
    // printf("Output of class %d: %f\n", i, output[i]);
        if (output[i] > max_value) {
            max_value = output[i];
            *predict_class = i;
        }
    }
}
/* ******************** lenet model layers ******************** */


/* ******************** lenet function ******************** */
int lenet(float input_image[INPUT_SIZE][INPUT_SIZE]) {
    // layer output
    float conv1_output[CONV1_FILTERS][CONV1_OUTPUT_SIZE][CONV1_OUTPUT_SIZE]; // 6 x 24 x 24
    float pool1_output[CONV1_FILTERS][POOL1_OUTPUT_SIZE][POOL1_OUTPUT_SIZE]; // 6 x 12 x 12
    float conv2_output[CONV2_FILTERS][CONV2_OUTPUT_SIZE][CONV2_OUTPUT_SIZE]; // 16 x 8 x 8
    float pool2_output[CONV2_FILTERS][POOL2_OUTPUT_SIZE][POOL2_OUTPUT_SIZE]; // 16 x 4 x 4

    float fc_input[CONV2_FILTERS * POOL2_OUTPUT_SIZE * POOL2_OUTPUT_SIZE];
	float fc1_output[FC1_SIZE];
	float fc2_output[FC2_SIZE];
	float output[OUTPUT_CLASSES];
    int   predict_class;

    // convolution + max pooling layer
    conv2d_layer1(input_image, conv1_output);
    max_pool1(conv1_output, pool1_output);

    conv2d_layer2(pool1_output, conv2_output);
    max_pool2(conv2_output, pool2_output);

    // flatten layer
    flatten(pool2_output, fc_input);

	// fully connected layer
	fully_connected_fc1(fc_input, fc1_output, fc1_weights, fc1_biases, CONV2_FILTERS * POOL2_OUTPUT_SIZE * POOL2_OUTPUT_SIZE, FC1_SIZE);
	fully_connected_fc2(fc1_output, fc2_output, fc2_weights, fc2_biases, FC1_SIZE, FC2_SIZE);
	fully_connected_fc3(fc2_output, output, fc3_weights, fc3_biases, FC2_SIZE, OUTPUT_CLASSES);
    predict(output, &predict_class);

    return predict_class;
}
/* ******************** lenet function ******************** */


/* ******************** bilinear resize ******************** */
void bilinear_resize(int src[HEIGHT][WIDTH], float dst[INPUT_SIZE][INPUT_SIZE]) {
    float x_ratio = (float)(WIDTH - 1) / INPUT_SIZE;
    float y_ratio = (float)(HEIGHT - 1) / INPUT_SIZE;

    for (int y = 0; y < INPUT_SIZE; y++) {
        for (int x = 0; x < INPUT_SIZE; x++) {
            float gx = x * x_ratio;
            float gy = y * y_ratio;
            int x0 = (int)gx;
            int y0 = (int)gy;
            int x1 = (x0 + 1 < WIDTH)  ? x0 + 1 : x0;
            int y1 = (y0 + 1 < HEIGHT) ? y0 + 1 : y0;

            // Get pixel values at 4 neighboring points
            int P00 = src[y0][x0]; // Top-left
            int P10 = src[y0][x1]; // Top-right
            int P01 = src[y1][x0]; // Bottom-left
            int P11 = src[y1][x1]; // Bottom-right

            // Compute interpolation weights
            float dx = gx - x0;
            float dy = gy - y0;

            // Bilinear interpolation formula
            float P_top = P00 * (1 - dx) + P10 * dx;
            float P_bot = P01 * (1 - dx) + P11 * dx;
            dst[y][x] = P_top * (1 - dy) + P_bot * dy;
        }
    }
}
